import { Container, Box } from "@mui/material";

export default function Profile() {
  return (
    <Container sx={{ height: '100vh', width: '100vw'}}>
      <Box>

      </Box>
      <Box sx={{
        maxHeight: '35%'
      }}>
        <p>
        In this example, we're creating a Scrollable component with a fixed width and height of 300px, and then wrapping some content inside it. This will create a scrollable box with a scrollbar that allows the user to scroll vertically to see all the content.

You can customize the scrollbar and other properties of the Scrollable component by passing in props like sx, classes, and component.
        </p>
      </Box>
    </Container>
  )
}
